@Component({
  selector: 'medcoding-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent {
  title = 'admin';
}
<a routerLink="/admin">Home</a>
<a routerLink="/admin/category">Category</a>
